import React, { Component } from "react"

export default class Enquete extends Component {
    render() {
        const enquete = this.props.enquente

        return (
            <div>
                <h3>Título</h3>
                <span>{enquete.titulo}</span>
                <div>Data de início</div>
                <span>{enquete.inicio}</span>
                <div>Data de termino</div>
                <span>{enquete.fim}</span>
            </div>
        )
    }
}
